import React from "react";
import classes from "./UsersList.module.css";

const UsersList = (props) => {
  console.log("listuser list ", props.userList);

  return (
    <div className={classes.users}>
     {props.userList &&
          props.userList.map((user) => {
            return (
              <ul>
                <li>user.username</li>
              </ul>
            );
          })}
    </div>
  );
};

export default UsersList;
